CREATE TABLE PatientFeedback (
  feedback_id INT PRIMARY KEY,
  patient_id INT,
  satisfaction_score INT,
  feedback_text TEXT
);

CREATE TABLE TelehealthService (
  service_id INT PRIMARY KEY,
  service_name TEXT,
  service_type TEXT,
  service_rating INT
);

CREATE TABLE patients_feedback (
    patient_id SERIAL PRIMARY KEY,
    rating INTEGER NOT NULL,
    feedback TEXT
);

CREATE TABLE survey_responses (
    survey_id SERIAL PRIMARY KEY,
    patient_id INTEGER,
    question TEXT,
    response TEXT
);

CREATE TABLE telehealth_service_quality (
    service_id SERIAL PRIMARY KEY,
    service_name TEXT,
    service_rating INTEGER
);

CREATE TABLE SatisfactionSurveys (
  survey_id INT PRIMARY KEY,
  patient_id INT,
  satisfaction_rating INT,
  survey_date DATE
);

CREATE TABLE TelehealthServices (
  service_id INT PRIMARY KEY,
  service_name VARCHAR(50),
  service_description TEXT
);

CREATE TABLE TelehealthService (
    service_id INT PRIMARY KEY,
    service_name VARCHAR(255),
    service_type VARCHAR(50),
    service_description TEXT
);

CREATE TABLE HealthCareProvider (
    provider_id INT PRIMARY KEY,
    provider_name VARCHAR(255),
    provider_type VARCHAR(50),
    provider_location VARCHAR(255)
);

CREATE TABLE PatientDetails (
    patient_id INT PRIMARY KEY,
    patient_name VARCHAR(255),
    patient_age INT,
    patient_gender VARCHAR(10)
);
